⁣
Pero, ¿cuánto estamos dispuestos a pagar por un vino de calidad?🤔⁣
⁣
Aquí una lista de los vinos más caros del mundo👇🏻.⁣
⁣
💲🍷Chateau Lafite 1869.⁣
La casa de subastas estimó que se vendería por unos modestos 8.000 dólares pero, para su sorpresa, un postor anónimo asiático hizo una oferta de 230.000 dólares y se quedó con él.⁣
⁣
💲🍷Shipwrecked 1907 Heidsieck.⁣
Pagar 275.000 dólares por una botella de champán puede parecer una excentricidad para la mayoría de la gente, pero este vino tiene una historia única y emocionante a sus espaldas, ¿no la conoces?😱⁣
⁣
💲🍷Cheval Blanc 1947.⁣
Se trata de un raro Burdeos hallado en la cava de un coleccionista y que fue adquirida por un comprador secreto en una subasta por poco más de 270.000 euros y que tuvo lugar en la casa Christie’s de Ginebra (Suiza).⁣
⁣
⁣
💲🍷Chateau Mouton-Rothschild 1945.⁣
Se trata de una botella Jeroboam, de 4,5 litros, el equivalente a seis botellas estándar de 750 ml. Está valuada en unos 310.000 $⁣
⁣
⁣
💲🍷Screaming Eagle Cabernet 1992.⁣
Este vino californiano es, desde el año 2000, el más caro del mundo. Chase Bailey pagó por esa sola botella medio millón de dólares. Eso sí, la botella es tamaño Imperial o, lo que es lo mismo, una que alberga seis litros.⁣
⁣
